import { NAME, ADD } from 'action_type/index';

const update_name = ({type, payload}) => {
  switch (type) {
    case NAME:
      return payload.NAME;
    default:
      return null;
  }
}

const update_add = ({type,payload}) => {
  switch (type) {
    case ADD:
      return payload.add;
    default:
      return null;
  }
}

export {update_name,update_add};
